import React from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Grid from '@mui/material/Grid';
import SIFA from "../../assets/img/logos/SIFA FC.png"
// import SIFA from 'src/assets/img/logos/SIFA FC.png'
// src\assets\img\logos\AU+NEPAD Logo.png

const Partners = () => {
  return (
    <Box className="bg-light py-5">
      <Box className="container">
        <Typography variant="h4" sx={{ color: '#1363C6', textAlign: 'center' }}>
            ,
          Partners
        </Typography>
        <Grid container spacing={5} justifyContent="center" alignItems="center" className="sponsor-logos mt-5">
          {[
                 { src : {SIFA}, alt: 'Sponsor 1' },
            { src: 'src/assets/img/logos/AU_LOGO_ENGLISH_CMYK.png', alt: 'Sponsor 4' },
            { src: '../../assets/img/logos/AUDA-NEPAD_LOGO_EN.png', alt: 'Sponsor 5' },
            { src: '.assets/img/logos/BMZ Logo.png', alt: 'Sponsor 2' },
            { src: '.assets/img/logos/EN Co-funded by the EU_PANTONE.jpg', alt: 'Sponsor 4' },
            { src: '.assets/img/logos/KfW_LOGO.png', alt: 'Sponsor 3' },
            { src: 'assets/img/SSF_Logo_transparent_RGB.png', alt: 'Sponsor 3' },
            { src: 'assets/img/TVETA.png', alt: 'Sponsor 3' },
            { src: 'assets/img/ARSO-LOGO-2-pr.jpg', alt: 'Sponsor 3' },
            { src: 'assets/img/FESTO.png', alt: 'Sponsor 3' },
            { src: 'assets/img/SIEMENS.png', alt: 'Sponsor 3' },
          ].map((logo, index) => (
            <Grid item key={index} className="col-auto">
              <img
                src={logo.src}
                alt={logo.alt}
                className="sponsor-logo"
                style={{
                  width: '150px',
                  margin: '10px 30px',
                  padding: '50px 0',
                }}
              />
            </Grid>
          ))}
        </Grid>
      </Box>
    </Box>
  );
};

export default Partners;
